import React from 'react';
import ReactDom from 'react-dom';

let currdate=new Date();
 date=currdate.getDate();
 time=currdate.getTime();


ReactDom.render(
    <>


    <h1>Satish Maurya</h1>
    <p>{`current date is:{date}`}</p>

    <p>{`current time is:{time}`}</p>



    </>,
    document.getElementById('root')
)
